You’ve never heard of a Holidate?  It’s the perfect plus-one!  That non-romantic friend who escorts you to an otherwise awkward holiday event when you don’t have a significant other.  Watch us all try to try to find romance this Holiday season in the hilarious HOLIDATE on October 28th only on Netflix.  #FindYourHolidate @Netflix @NetflixFilm 
